from collections import Counter

class Solution(object):
	def findAnagrams(self, s, p):
		result = []
		cp = Counter(p)
		cs = None
		for i in range(len(s)-len(p)+1):
			if cs == None:
				cs = Counter(s[:len(p)])
			else:
				cs[s[i-1]] -= 1
				if cs[s[i-1]] == 0:
					del cs[s[i-1]]
				if s[len(p)+i-1] in cs:
					cs[s[len(p)+i-1]] += 1
				else:
					cs[s[len(p)+i-1]] = 1
			if cs == cp:
				result.append(i)
		return result

print(Solution().findAnagrams("",
""))